import './App.css';
import React from 'react'
import Nav from './components/nav/Nav.tsx';
import { Route ,Routes} from 'react-router-dom';
import PlanPage from './components/planPage/PlanPage.tsx';
import TablePage from './components/tablePage/tablePage.tsx';

const App = () => {
  return (
    <>
      <Nav />
      <Routes>
        <Route to="/plan" element={<PlanPage />}/>
        <Route to="/table" element={<TablePage />}/>
      </Routes>
    </>
  )
}    

export default App
